import ExpenseItem from "./components/ExpenseItem";

function App() {
    const expenses = [
        { title: "Car Insurance", amount: 294.67, date: new Date(2008, 1, 2) },
        { title: "Car Insurance", amount: 294.67, date: new Date(2012, 3, 4) },
        { title: "Car Insurance", amount: 294.67, date: new Date(2016, 5, 6) },
    ];
    return (
        <div>
            <h2>Let's get started!!</h2>
            <ExpenseItem expense = {expenses[0]} />
            <ExpenseItem expense = {expenses[0]} />
            <ExpenseItem expense = {expenses[0]} />
        </div>
    );
}

export default App;
